import React from 'react';
import Theme from './theme';
import codeclastLogo from '../../assets/img/codeclastfulllogo.png';

function Nav({ currentContent, handleContentChange }) {
    //sends change page content request to useState in App.js, colors active button 
    const onClick = (e) => {
        const page = e.target.className;
        handleContentChange(page);
    }

    //logo, theme and nav bar
    return (
        <header>
            <nav>
                <h1>
                    <img src={codeclastLogo} className="logo" alt="CODECLAST"></img>
                </h1>
                <Theme />
                <div className="navbox" onClick={(e) => onClick(e)}>
                    <h2 href="#about" className={currentContent === 'about' ? 'about active' : about}>/about</h2>
                    <h2 href="#portfolio" className={currentContent === page ? `${page} active`: page}>/portfolio</h2>
                    <h2 href="#resume" className={currentContent === page ? `${page} active`: page}>/resume</h2>
                    <h2 href="#contact" className={currentContent === page ? `${page} active`: page}>/contact</h2>
                </div>
            </nav>
        </header>
    )
};

export default Nav;
